import styled from 'styled-components';


export const StyledDiv = styled.div`
  background-color: gray;
  border: 2px solid black;
  padding: 14px;
  color: white;
  height:300px;
  width:200px
`

export const Image = styled.img`
height:150px;
width:150px;
`
